@iqbal-h , could be please do me a favor? Save the following code as t.c and compile it with your compiler(e.g. gcc or clang++).
```c
#include <iconv.h>
#include <stddef.h>
int main() {
  char *a, *b;
  size_t i, j;
  iconv_t ic;
  ic = iconv_open("to", "from");
  iconv(ic, &a, &i, &b, &j);
  iconv_close(ic);
}
```
Build command:
```bash
gcc -o t test.c -Wall -Wextra
```
Then you run
```
echo $?
```
It should say: "0".  It means the build command was successful. It means the iconv function is provided by glibc runtime, so that we do not need to link to an extra library for it. 

I need to know why sometimes it complains:
"undefined reference to libiconv_open"

It is suspicious because our code doesn't call this function directly. We use "iconv_open" instead of "libiconv_open". These two are different.  The iconv_open function is part of POSIX standard. All Linux systems should have it in their standard C runtime, which should by default exist everywhere. However, "libiconv_open" is a different story.
